spec:
Untuk mengukur dan merekam beberapa parameter cuaca. Parameter yang diukur, direkam, dan ditampilkan yaitu:
- Suhu udara (Air temperature);
- Kelembaban udara (Air humidity);
- Intensitas cahaya (Light intensity/ Illuminance);
- PAR (Photosynthetically Active Radiation);
- Kandungan gas CO2 di udara (CO2);
- Suhu tanah (Soil temperature);
- Kelembaban tanah (Soil moisture);
- pH tanah (Soil pH);
- Kadar garam tanah (Soil salinity);
- Arah angin (Wind direction);
- Kecepatan angin (Wind speed);
- Curah hujan (Rainfall);
- Kepadatan tanah (Soil
compaction}.

Untuk mengenalkan dan memberi keterampilan membuat benda kerja menggunakan mesin frais manual. Standard Accessory:
Machine Light, Coolant System, Machine Vice, Dividing Head, Rotary table, Clamp Kit, Tools and Toolbox.
Spindle speed: up to 4500 rpm. Distance from spindle to table up to 400 mm;
Transverse travel approx. 300 mm;
Vertical travel approx. 400 mm; table size: min. 250 x 1250 mm; Longitudinal travel approx.
720mm;

Untuk memotong  plat logam  non logam  dan gravir dengan program
komputer. Laser cut  power  approx.  500 watt;
Work  area approx.  min  1000x2000 mm.

